--select F_Devices from ED_Devices_Pts where link = 895560

DECLARE 
	@F_Division		TINYINT,
	@F_SubDivision	TINYINT,
	@F_Devices		int,
	@F_Subscr		NVARCHAR(max),
	@F_book			INT,
	@N_Period		INT,
	@N_Year			INT,
	@del			bit,
	@F_energy_types	INT,
	@C_Serial_Number varchar(50)

	SET @F_Division		= null--24		---	Отделение
	SET @F_SubDivision	= null--70		--	Участок
	SET @F_book			= null--21		-- книга
	SET	@F_Subscr		= null--20789861	--	Идентификатор лицевого счета
	set @F_devices		= 14500801
	SET	@N_Year			= 2022	--	 период вставки профили
	set @del			= 1			--  удалять профили
	set @F_energy_types = 9
	set @C_Serial_Number  = '009217074002043'


if @F_devices is null
begin
	
	--поиск 1 ПУ
	select top 1 
		@F_Division		=F_Division,
		@F_SubDivision	=F_SubDivision,
		@F_Devices		=LINK,
		@C_Serial_Number=ed.C_Serial_Number
	from ED_Devices ed where ed.C_Serial_Number like '%'+ @C_Serial_Number + '%' 
end

if @F_devices is not null
begin
	
	--поиск 1 ПУ
	select top 1 
		@F_Division		=F_Division,
		@F_SubDivision	=F_SubDivision,
		@F_Devices		=LINK,
		@C_Serial_Number=ed.C_Serial_Number
	from ED_Devices ed where ed.LINK = @F_devices
end
--select 
--	@F_Division	,	
--	@F_SubDivision	,
--	@F_Devices		,
--	@C_Serial_Number



IF @del = 1 
	BEGIN
		DELETE FROM dbo.ED_Meter_Profiles  WHERE N_Year = @N_Year AND F_Division = @F_Division and (F_Devices= @F_Devices) and (F_Energy_Types=@F_energy_types)
	END



