insert into ED_Meter_Profiles  

       ( [F_Division]
      ,[F_SubDivision]
      ,[F_Devices]

      ,[F_Energy_Types]

      ,[F_Delivery_Methods]
      ,[D_Date_Begin]
      ,[D_Date_End]
      ,[B_Main]

      ,[N_Cons]

      ,[N_Count]
      ,[N_Quantity])


select
       
       @F_Division as [F_Division]
      ,@F_SubDivision as [F_SubDivision]
      ,@F_Devices as [F_Devices]

      ,[F_Energy_Types]

      ,18 as [F_Delivery_Methods]
      ,cp.D_Date0 as  [D_Date_Begin]
      ,cp.D_Date1 as  [D_Date_End]
      ,[B_Main]
      ,[N_Cons]
      ,[N_Count]
      ,[N_Quantity]

FROM tmp.ED_Meter_Profiles_for_impotr t
inner join   dbo.CS_Periods cp
  on cp.N_Year=@N_Year
  and t.N_Month=cp.N_Month
where t.F_Energy_Types=@F_energy_types
 


